import React, { Component } from "react";
import Checkbox from '@material-ui/core/Checkbox';
import DeleteOutlinedIcon from '@material-ui/icons/DeleteOutlined';
import EditOutlinedIcon from '@material-ui/icons/EditOutlined';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';

class Elemento extends Component{
	state={
		acciones:false
	}
	showme=e=>{
		console.log(e.parent);
	}

	render(){
		return(
			<Grid container key={this.props.key} alignItems="center" spacing={1}>
			<Grid item>
				<Checkbox color="primary"/></Grid><Grid item><span onClick={this.showme}>{this.props.elemento}</span>
				<EditOutlinedIcon style={{display:"none"}} />
				<DeleteOutlinedIcon style={{display:"none"}} />
				</Grid>
			</Grid>
		)
	}
}

export default Elemento
